/* eslint-disable react/no-unused-state */
import { Icon } from '@iconify/react';
import { Link } from 'react-router-dom';
import React, { Component } from 'react';

// material
import {
  Grid,
  Button,
  Container,
  Stack,
  Typography,
  Slider,
  Divider,
  FormGroup,
  FormControlLabel,
  Switch,
  TextField
} from '@mui/material';
// components
import Tooltip from '@mui/material/Tooltip';
import { Box, maxHeight } from '@mui/system';
import PropTypes from 'prop-types';
import NumberFormat from 'react-number-format';
import DataService from '../services/db.services';
import Page from '../components/Page';

//

// ----------------------------------------------------------------------

const marks = [
  {
    value: 0,
    label: '0%'
  },
  {
    value: 20,
    label: '20%'
  },
  {
    value: 40,
    label: '40%'
  },
  {
    value: 60,
    label: '60%'
  },
  {
    value: 80,
    label: '80%'
  },
  {
    value: 100,
    label: '100%'
  }
];

export default class Settings extends Component {
  constructor(props) {
    super(props);
    this.onChangeTitle = this.onChangeTitle.bind(this);
    this.getTutorial = this.getTutorial.bind(this);
    this.updateTutorial = this.updateTutorial.bind(this);
    this.newTutorial = this.newTutorial.bind(this);
    this.saveTutorial = this.saveTutorial.bind(this);

    this.state = {
      currentTutorial: {
        id: null,
        title: '',
        description: '',
        published: false
      },
      message: ''
    };
  }

  onChangeTitle(e) {
    const title = e.target.value;
    this.setState((prevState) => ({
      currentTutorial: {
        ...prevState.currentTutorial,
        title
      }
    }));
  }

  getTutorial(id) {
    DataService.get(1)
      .then((response) => {
        this.setState({
          currentTutorial: response.data
        });
        console.log(response.data);
      })
      .catch((e) => {
        console.log(e);
      });
  }

  updatePublished(status) {
    const data = {
      id: 1,
      title: 'ttitle',
      description: 'thdescription',
      published: status
    };
    DataService.update(1, data)
      .then((response) => {
        this.setState((prevState) => ({
          currentTutorial: {
            ...prevState.currentTutorial,
            published: status
          }
        }));
        console.log(response.data);
      })
      .catch((e) => {
        console.log(e);
      });
  }

  saveTutorial() {
    const data = {
      title: this.state.title,
      description: this.state.description
    };
    DataService.create(data)
      .then((response) => {
        this.setState({
          id: 1,
          title: ' response.data.title',
          description: 'response.data.description',
          published: 1,
          submitted: true
        });
        console.log(response.data);
      })
      .catch((e) => {
        console.log(e);
      });
  }

  updateTutorial() {
    DataService.update(this.state.currentTutorial.id, this.state.currentTutorial)
      .then((response) => {
        console.log(response.data);
        this.setState({
          message: 'The tutorial was updated successfully!'
        });
      })
      .catch((e) => {
        console.log(e);
      });
  }

  render() {
    return (
      <Page title="Settings">
        <Container maxWidth="xl">
          <Stack direction="row" alignItems="center" justifyContent="space-between" mb={0}>
            <Typography variant="h4" gutterBottom style={{ color: '#66fcf1' }}>
              Settings
            </Typography>
          </Stack>
          <Container maxWidth="xl">
            <Grid paddingTop={1}>
              <Divider>
                <Typography variant="h5" gutterBottom style={{ color: '#66fcf1' }}>
                  Speed Settings
                </Typography>
              </Divider>

              <Grid container spacing={{ xs: 10 }} columns={{ xs: 8, sm: 8, md: 8, lg: 8 }}>
                <Grid item xs={2}>
                  <Typography variant="h6" gutterBottom style={{ color: '#45a29e' }}>
                    Robot Foward Speed
                  </Typography>
                  <Slider
                    defaultValue={50}
                    step={10}
                    min={0}
                    max={100}
                    marks={marks}
                    style={{ color: '#45a29e', alignSelf: 'center' }}
                  />
                </Grid>
                <Grid item xs={2}>
                  <Typography variant="h6" gutterBottom style={{ color: '#45a29e' }}>
                    Robot Backwards Speed
                  </Typography>
                  <Slider
                    defaultValue={50}
                    step={10}
                    min={0}
                    max={100}
                    marks={marks}
                    style={{ color: '#45a29e', alignSelf: 'center' }}
                  />
                </Grid>
                <Grid item xs={2}>
                  <Typography variant="h6" gutterBottom style={{ color: '#45a29e' }}>
                    Robot Turning Speed
                  </Typography>
                  <Slider
                    defaultValue={50}
                    step={10}
                    min={0}
                    max={100}
                    marks={marks}
                    style={{ color: '#45a29e', alignSelf: 'center' }}
                  />
                </Grid>
                <Grid item xs={2}>
                  <Typography variant="h6" gutterBottom style={{ color: '#45a29e' }}>
                    Acceleration
                  </Typography>
                  <Slider
                    defaultValue={50}
                    step={10}
                    min={0}
